import grammar from './images/grammar.svg'

const Grammar = () => {
    return (
        <div className='module1'>
            <div className="title"><img src={grammar} className="image2" /><h2 className='word'>Alphabets</h2></div><br></br>
            <div className="title-content"><h5>Get started with learning alphabets in Yoruba<br></br>Lets GO!</h5></div>
        </div>
    )
}

export default Grammar
